import styled from "styled-components/macro";

const Wrapper = styled.div`
  .nav-links {
      font-size: 11px;
  }

  .capco-logo {
    // position: absolute;
    width: 170vm;
    height: 20.38px;
    // left: calc(50% - 170px/2 - 715px);
    top: 0px;
  }
`;

export default Wrapper;
